@valentiniemmanu -è folle obbligare al vaccino giovani e bambini, hanno rischio 0, anzi hanno potenziali rischi dal vaccino
-Omicron è molto meno aggressiva (1/5 di TI e 1/10 di morti rispetto a Delta)
-0 investimenti su SSN, 0 medicina territoriale

@valentiniemmanu Ok, ora ho capito cosa intende. Purtroppo è ormai chiaro che non lo fanno per salvaguardare il SSN perchè altrimenti:
-avrebbero investito sulle cure precoci anzichè ostracizzarle
-si sarebbero concentrati su vaccinare le fasce a rischio, gli under 60 hanno rischio praticamente 0

